岗位主要工作职责：
配合数据治理相关工作，做好分配项目数据接入、数据治理、数据目录建立等相关项目的支撑及交付工作。

岗位知识技能及阅历要求：
1、本科及以上学历，计算机，数学相关专业优先；
2、对数字有强烈的敏感度，具备较强的数据分析及问题的解决能力；
3、熟悉Excel等办公软件，熟练掌握SQL语言，能用各种应用软件进行数据分析及综合数据处理；
4、具备快速学习和思考能力、敏锐的数据洞察力及结构化思维能力；
5、责任心强，抗压性强，敢于挑战和突破。

双休，工作时间9:00-17:30，入职缴纳五险一金

【工作"氛围"】
·业内领先的行业解决方案团队和实战经验，最行业内前沿的圈子资讯;
·1V1的师带徒,所有疑惑都能快速解答;
·严谨周密的实战培训体系,让每位伙伴都能快速成长;
·积极、乐观、正向的价值观,坦诚、低成本沟通的团队文化;
·年轻、渴望向上生长、相互鼓励的团队伙伴们。

【你将与他们一起奋斗】
参与到各个行业国内最头部的私域商业项目和客户团队

【薪酬福利】
·强竞争力的薪资体系，高收入的阿米巴绩效和12薪满额激励，入职即缴五险一金；
·全薪病假,带薪年假等休假福利;
·有出差补贴，住宿标准等; 
·每周的下午茶福利和日常加班自助式的餐贴；
·公司提供电脑(自带可享50元/月电脑补贴);
·宽敞的办公环境,提供人体工程学座椅;
·及有一个业内顶尖的特种兵团队陪练。
